let chunks = {
	1: c1,
	2: c2, 
	3: c3,
	4: c4,
};


// Below is the function for generating the terrain (both normal and flat)
// Maybe choose a random number between 1 and 40 for height

let terrainType = 1; // 1 = normal, 2 = flat
let terrainRowLength_y = 0; // Determines the vertical length of terrain
let y_rowGenerationTime = 0; // Time until done generating terrain row on the Y axis
let x_rowGenerationTime = 0; // Time until done generating terrain row on the X axis
let YlengthUntilSwitchMaterial = 0; 
let materialToGenerateTerrainWith = 1;
let startNewVerticalRow = false;

// The functions below set normal and flat terrain variables to their default values before generating the terrain
function configureNormalTerrain() {
	materialToGenerateTerrainWith = 1;
	terrainRowLength_y = Math.floor((Math.random()* 40) + 1); 
	YlengthUntilSwitchMaterial = Math.floor((Math.random()* 15) + 1);
}

function configureFlatTerrain() {
	materialToGenerateTerrainWith = 1;
	YlengthUntilSwitchMaterial = 30;
	terrainRowLength_y = 8;
}

// To actually generate the terrain and DRAW it!!!
function generateTerrain() {
	if (terrainType == 1) { // normal terrain
		
		// for the Y generation (vertical)
		if (y_rowGenerationTime > YlengthUntilSwitchMaterial) { materialToGenerateTerrainWith = 3; }
		
		// for the X generation (horizontal)
		if (startNewVerticalRow) {
			terrainRowLength_y = Math.floor((Math.random()* 40) + 1);
			YlengthUntilSwitchMaterial = Math.floor((Math.random()* 10) + 1);
			materialToGenerateTerrainWith = 1;
			y_rowGenerationTime = 0;
			startNewVerticalRow = false;
		}
		
	}
	
	if (y_rowGenerationTime < terrainRowLength_y) { 
		chunks[whichChunk][whichBlockOnChunk] = materialToGenerateTerrainWith;
	}
	y_rowGenerationTime++;
	x_rowGenerationTime++;
}
